import React from 'react';
import s from './HeaderBlock.module.css';

import ReactLogo from '../HeaderBlock/img/logo.png';



const HeaderBlock = ({title}) => {
    return (
        <div>
            <div className={s.cover}>
                <div className={s.wrap}>
                    <h1 className={s.header}>{title}</h1>
                    <img src={ReactLogo}/>
                    <p className={s.descr}>Воспользуйтесь карточками 
                    для запоминания и пополнения активных словарных 
                    запасов.</p>
                </div>
            </div>
        </div>
    );
}

export default HeaderBlock;
